import React from 'react';
import { Plus } from 'lucide-react';
import '../../styles/MonthlyOverview.css';

const MonthlyOverview = ({ expenses, onAddExpense }) => {
  // Check if there are any expenses
  const hasExpenses = expenses.length > 0;

  // Get current month
  const currentMonth = new Date().toLocaleString('default', { month: 'long', year: 'numeric' });

  // Calculate monthly totals
  const currentMonthExpenses = expenses.filter(exp => {
    const expenseDate = new Date(exp.date);
    const now = new Date();
    return expenseDate.getMonth() === now.getMonth() && 
           expenseDate.getFullYear() === now.getFullYear();
  });

  const totalIncome = currentMonthExpenses
    .filter(expense => expense.type === 'income')
    .reduce((sum, expense) => sum + expense.amount, 0);

  const totalExpenses = currentMonthExpenses
    .filter(expense => expense.type === 'expense')
    .reduce((sum, expense) => sum + expense.amount, 0);

  const balance = totalIncome - totalExpenses;

  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD'
    }).format(amount);
  };

  if (!hasExpenses) {
    return (
      <div className="monthly-overview">
        <div className="overview-header">
          <h2>Monthly Overview</h2>
          <span className="month-label">{currentMonth}</span>
        </div>

        <div className="empty-state">
          <div className="empty-state-icon">ðŸ“Š</div>
          <h3>No expenses recorded yet</h3>
          <p>Click the + button to add your first expense!</p>
          <button 
            className="add-expense-btn"
            onClick={onAddExpense}
          >
            <Plus size={18} />
            Add First Expense
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="monthly-overview">
      <div className="overview-header">
        <h2>Monthly Overview</h2>
        <span className="month-label">{currentMonth}</span>
      </div>

      <div className="overview-stats">
        <div className="stat-item">
          <div className="stat-icon income">ðŸ’°</div>
          <div className="stat-content">
            <span className="stat-label">Income</span>
            <span className="stat-value">{formatCurrency(totalIncome)}</span>
          </div>
        </div>

        <div className="stat-item">
          <div className="stat-icon expense">ðŸ’³</div>
          <div className="stat-content">
            <span className="stat-label">Expenses</span>
            <span className="stat-value">{formatCurrency(totalExpenses)}</span>
          </div>
        </div>

        <div className="stat-item">
          <div className={`stat-icon ${balance >= 0 ? 'balance' : 'negative'}`}>
            ðŸ“Š
          </div>
          <div className="stat-content">
            <span className="stat-label">Balance</span>
            <span className={`stat-value ${balance >= 0 ? 'positive' : 'negative'}`}>
              {formatCurrency(balance)}
            </span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MonthlyOverview;
